import React from "react";
import "./Landing.css";
import { Link } from "react-router-dom";
import handshake from "../../Images/handshake.webp";
function Landing() {
  // const SignInHandler = () => {
  //   console.log("worked");
  // };
  return (
    <div>
      <div class="container">
        <span className="Studentsclick">Students</span>
        <span className="Employersclick"> Employers</span>
        <Link
          className="Signinclick"
          className="navbar-btn"
          to="./../Signin/Pages/Signin"
        >
          SignIn
        </Link>
      </div>
      <div className="diva">
        <img src={handshake} alt="HandShake" />
      </div>
    </div>
  );
}

export default Landing;
